import "./App.css";
import Video from "./components/Video";
import AddVideoForm from "./components/AddVideoForm"
import VideoList from "./components/VideoList";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Video Recommendation</h1>
      </header>

      <VideoList />
      <AddVideoForm />
    </div>
  );
}

export default App;
